import styles from "../contents/contactUs.module.css";
import { CSSTransition } from "react-transition-group";
import { useState } from "react";
import "./styles.css";

export default function PersonalCard(props) {
  const [fadeCard, setFadeCard] = useState(false);
  return (
    <>
      <CSSTransition in={fadeCard} classNames="card1" timeout={300}>
        <div className={styles.card}>
          <div className={styles.profileImgArea}>
            <div className={styles.profileImg}></div>
            <div className={styles.profileText}>
              <h3>{props.name}</h3>
              <span>{props.infoText}</span>
            </div>
          </div>
          <div className={styles.profileArea}>
            <div className={styles.profileFirst}>
              <div className={styles.phone}></div>
              <div className={styles.github}></div>
              <div className={styles.email}></div>
              <div className={styles.github}></div>
            </div>
            <div className={styles.profileSecond}>
              <h4 style={{ color: "white" }}>Personal info.</h4>
            </div>
          </div>
        </div>
      </CSSTransition>
      <button
        onClick={() => {
          setFadeCard((prev) => !prev);
          console.log(fadeCard);
        }}
      >
        asdfasdf
      </button>
    </>
  );
}
